import React, { Component } from 'react';

import './css/footer.css';

class Footer extends Component {

    render() {
        return (
            <>
                <footer id="footer">
                    <ul>
                        <li><img src="/img/logo.png" /> </li>
                        <li>Ayam Berkokok For Final Project Bootcamp Reactjs 0720 by Gefy Aqiilah Aqshal</li>
                        <li>Ayam Berkokok &copy; Gefy Aqiilah Aqshal</li>
                    </ul>

                </footer>
            </>

        )
    }
}

export default Footer;
